class Solution {
    private fun primeFactors(n: Int): Int {
        var count = 0
        var number = n
        if (number % 2 == 0) {
            count++
            while (number % 2 == 0) number /= 2
        }
        var i = 3
        while (i <= Math.sqrt(number.toDouble()).toInt()) {
            if (number % i == 0) {
                count++
                while (number % i == 0) number /= i
            }
            i += 2
        }
        if (number > 2) count++
        return count
    }

    fun maximumScore(nums: List<Int>, k: Int): Int {
        val mod = 1000000007
        val scores = nums.map { primeFactors(it) to it }.sortedWith(compareBy({ -it.first }, { it.second }))
        var result = 1L
        for (i in 0 until k) {
            result = (result * scores[i].second) % mod
        }
        return result.toInt()
    }
}
